import React, { useState } from 'react';
import { getWeather } from '../services/api';
import { WeatherData } from '../types';

const Home: React.FC = () => {
  const [city, setCity] = useState<string>('');
  const [weather, setWeather] = useState<WeatherData | null>(null);
  const [loading, setLoading] = useState<boolean>(false);
  const [error, setError] = useState<string | null>(null);

  const handleSearch = async (e: React.FormEvent) => {
    e.preventDefault();
    
    if (!city.trim()) {
      setError('Please enter a city name');
      return;
    }

    setLoading(true);
    setError(null);
    
    try {
      const data = await getWeather(city);
      setWeather(data);
    } catch (err) {
      setError('City not found. Please try again.');
      setWeather(null);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="row justify-content-center">
      <div className="col-md-8">
        <div className="card shadow">
          <div className="card-body">
            <h2 className="text-center mb-4">Weather Dashboard</h2>
            
            <form onSubmit={handleSearch}>
              <div className="input-group mb-3">
                <input
                  type="text"
                  className="form-control"
                  placeholder="Enter city name"
                  value={city}
                  onChange={(e) => setCity(e.target.value)}
                />
                <button 
                  className="btn btn-primary" 
                  type="submit"
                  disabled={loading}
                >
                  {loading ? 'Searching...' : 'Search'}
                </button>
              </div>
            </form>
            
            {error && (
              <div className="alert alert-danger" role="alert">
                {error}
              </div>
            )}
            
            {weather && (
              <div className="weather-card card mt-4">
                <div className="card-header bg-primary text-white">
                  <h3 className="mb-0">
                    {weather.name}, {weather.sys.country}
                  </h3>
                </div>
                <div className="card-body">
                  <div className="row align-items-center">
                    <div className="col-md-6 text-center">
                      <img
                        src={`http://openweathermap.org/img/wn/${weather.weather[0].icon}@2x.png`}
                        alt={weather.weather[0].description}
                        className="img-fluid"
                      />
                      <h4>{weather.weather[0].main}</h4>
                      <p className="text-muted">{weather.weather[0].description}</p>
                    </div>
                    <div className="col-md-6">
                      <div className="mb-2">
                        <h2>{Math.round(weather.main.temp)}°C</h2>
                        <p className="text-muted">Feels like: {Math.round(weather.main.feels_like)}°C</p>
                      </div>
                      <div className="row mt-3">
                        <div className="col-6">
                          <p><strong>Humidity:</strong> {weather.main.humidity}%</p>
                        </div>
                        <div className="col-6">
                          <p><strong>Wind:</strong> {weather.wind.speed} m/s</p>
                        </div>
                        <div className="col-6">
                          <p><strong>Pressure:</strong> {weather.main.pressure} hPa</p>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
